		case 0: j =  s; k =  c; d = 0x0000; break;
		case 1: j = -c; k =  s; d = 0x4000; break;
		case 2: j =  c; k = -s; d = 0xC000; break;
		case 3: j = -s; k = -c; d = 0x8000; break;
